import logo from '../assets/../images/m.g2.png';
import '../assets/../css/FooterNav.css';
import Homepage from '../components/Homepage';
import About from '../components/About';
import Contact from '../components/Contact';
// import Card from '../components/Cards';
import React,{useState,useEffect} from 'react';
import { Routes, Route, Link } from "react-router-dom";

  const BestSellers = () =>{
    const [data,setData]=useState([]);
  const getData=()=>{
    fetch('../Photos.json'
    ,{
      headers : { 
        'Content-Type': 'application/json',
        'Accept': 'application/json'
       }
     }
    )
      .then(function(response){
        console.log(response)
        return response.json();
      })
      .then(function(myJson) {
        console.log(myJson);
        setData(myJson)
      });
  }

  const filtered = data.filter(data => {
    return data.description === "bestseller";
  }); 

  useEffect(()=>{
    getData()
  },[])
  return (
    <div className="">
     {
       data && data.length>0 && filtered.map((item)=><div><p>{item.name}</p> <img src={`${item.url}`} alt=""style={{ marginLeft: 5, marginRight: 5, height: 400 }}></img></div>)
     }
    </div>
  );
    }
